import React from "react";

function Users() {
  return (
    <>
      <strong>
        <p>Users</p>
      </strong>
      <ul>
        <li>
          <a href="/users/ivanov">Ivanov</a>
        </li>
        <li>
          <a href="/users/petrov">Petrov</a>
        </li>
      </ul>
    </>
  );
}

export default Users;
